class Solution:
    def divisorSum(self, n: int) -> int:
        return self.divisorSumHelper(1, n, 0)

    def divisorSumHelper(self, sum: int, n: int, index: int):
        if n == 0:
            return sum

        sum += n

        if sum >= n:
            return self.divisorSumHelper(sum, n-1, index+1)

        else:
            return self.divisorSumHelper(sum, n-1, index+1)

