class Solution:
    def fourSum(self, nums: List[int], target: int) -> List[List[int]]:
        def helper(left, right, numbers):
            if left > right or left > len(numbers) or right > len(numbers):
                return

            if left < right and numbers[left] + numbers[right] > target:
                return

            if numbers[left] + numbers[right] == target:
                return [numbers]

            if left + 1 < right:
                left_val, right_val = numbers[left], numbers[right]
                left_sum, right_sum = left_val + numbers[left] + numbers[right], target
                numbers[left], numbers[right] = left_sum, right_sum
                res = helper(left + 1, right, numbers)
                numbers[left], numbers[right] = left_val, right_val
                return res
            else:
                return []

        return helper(0, len(nums) - 1, sorted(nums))

